import Loading from "./Loading.js"



const Home = props => {
    const { promiseInProgress } = usePromiseTracker();

    return (
        promiseInProgress &&
        <div>
            <Game/>
            <DivisionStandings/>
            <PlayerGroup position="LW,RW,C"/>
            <PlayerGroup position="D"/>
            <PlayerGroup position="G"/>
        </div>
    );

}

  export default Home
